import axios from 'axios'

axios.defaults.withCredentials = true;

const API_URL = 'http://localhost:8000/'

class HistoryServices {
    payment() {
        return axios
            .get(API_URL + 'payment/',)
            .then(response => {

                return response.data
            })
    }

    booking() {
        return axios
            .get(API_URL + 'history/',)
            .then(response => {

                return response.data
            })
    }

    GroupBookingHistory(groupName){
        return axios
        .get(API_URL + 'group/'+ groupName)
        .then(response => {
            return response;
        })
    }

    PayOrCancel_get(){
        return axios
        .get(API_URL + 'history/booking/')
        .then(response => {
            return response;
        })
    }

    PayOrCancel_post(action,bookingid){
        return axios
        .post(API_URL + 'history/booking/',{
            action,
            bookingid
        })
        .then(response => {
            return response;
        })
    }

    Refund_get(){
        return axios
        .get(API_URL + 'history/refund/')
        .then(response => {
            return response;
        })
    }

    Refund_post(action,bookingid){
        return axios
        .post(API_URL + 'history/refund/',{
            action,
            bookingid
        })
        .then(response => {
            return response;
        })
    }
}

export default new HistoryServices();
